    <body>
      <div id="wrapper">
        <h1>내년 전기·가스요금 대폭 오를듯…올해보다 2배안팎 인상 추진</h1>
        <p class="data">입력 2022.12.15. 오후 7:38 수정 2022.12.16. 오전 7:10</p>
        <p class="name">홍국기 기자, 권희원 기자</p>
  
        <div
          class="txt"
          style="overflow-x: hidden; height: 450px">
          <p class="boldTxt">
            전기료 인상요인 kWh당 51.6원 산정…올해 인상분 19.3원의 2.7배<br />
            가스료는 MJ당 최대 10.4원 인상…올해보다 1.9배 오를 수도
          </p>
          <br />
  
          <figure>
            <img src="src/assets/htmls/images/news/img2_1.jpg" />
            <figcaption>전기요금 인상(PG)<br />[홍소영 제작] 일러스트</figcaption>
          </figure>
  
          <p>
            (서울=연합뉴스) 홍국기 권희원 기자 = 내년부터 대표적인 공공요금인
            전기요금과 가스요금이 올해 인상분의 2배 안팎으로 오를 것으로 보인다.
          </p>
          <p>
            15일 연합뉴스가 입수한 한국전력공사 경영 정상화 방안 문건에 따르면
            산업통상자원부와 한전은 내년 기준연료비를 포함한 전기요금 인상 요인을
            kWh(킬로와트시)당 51.6원으로 산정했다.
          </p>
  
          <p>
            전기요금은 기본요금·전력량요금(기준연료비)·기후환경요금·연료비
            조정요금으로 구성돼 있다.
          </p>
  
          <p>
            내년 인상 압력을 받는 전기요금 규모는 항목별로 kWh당 기준연료비
            45.3원, 기후환경요금 1.3원, 연료비 조정단가 5.0원이다. 연료비
            조정요금은 연간 상한을 kWh당 10원으로 확대한 것을 가정한 수치다.
          </p>
  
          <p>
            올해 전기료는 세 차례(4·7·10월)에 걸쳐 kWh당 전력량요금 2.5원,
            기준연료비 9.8원, 기후환경요금 2.0원, 연료비조정요금 5.0원씩 올라 총
            19.3원 인상됐다.
          </p>
          <p>
            내년에 인상 압력을 받는 전기료(kWh당 51.6원)가 올해 인상분(kWh당
            19.3원)의 2.7배에 달하는 셈이다.
          </p>
          <p>
            산업부와 한전은 올해 요금을 약 20% 인상했음에도 3분기까지
            21조8천억원의 적자가 발생했으며 올해 말 별도 기준으로 적자 규모가 약
            34조원에 이를 것으로 추산했다.
          </p>
          <p>
            또 만약 내년 전기료 인상 요인을 분기별 '전고후저'(前高後低) 방식으로
            분산 반영할 경우 영업이익이 1조9천억원의 흑자를 기록하지만, 분기별
            균등 분산 반영할 경우 연간 적자가 1조3천억원에 달할 것으로 내다봤다.
          </p>
          <p>
            나아가 내년 인상 요인을 3년간 분기별로 균등 분산하면 내년 영업 적자
            규모가 14조3천억원까지 확대되는 것으로 나타났다.
          </p>
          <p>
            산업부와 한전은 요금 정상화와 비용 최소화 노력 등을 통해 내년이나
            2024년 흑자로 전환한 뒤 2025∼2026년 누적 적자를 해소하고, 2027년
            말까지 경영을 정상화하는 방안을 제시했다.
          </p>
          <br />
          <figure>
            <img src="src/assets/htmls/images/news/img2_2.jpg" />
            <figcaption>
              서울 시내 주택 전기계량기(왼쪽)와 가스 계량기<br />
              [연합뉴스 자료사진]
            </figcaption>
          </figure>
  
          <p>
            이와 함께 한국가스공사도 경영 정상화를 위해 누적된 미수금을 조기에
            회수할 필요가 있다며 요금 인상을 추진 중이다.
          </p>
          <p>
            산업부와 가스공사는 가스요금을 내년 메가줄(MJ)당 최소 8.4원(2.1원씩 네
            분기) 혹은 최대 10.4원(2.6원씩 네 분기) 인상하는 방안을 내놨다.
          </p>
          <p>
            올해 가스요금은 주택용을 기준으로 네 차례(4·5·7·10월)에 걸쳐 5.47원
            올랐다. 내년에는 가스요금이 올해 인상분의 최소 1.5배에서 최대 1.9배로
            오르는 셈이다.
          </p>
          <p>
            산업부와 공사는 내년 요금을 메가줄당 8.4원 올리면 2027년부터, 10.4원
            올리면 2026년부터 미수금을 해소할 수 있을 것으로 분석했다.
          </p>
          <p>
            공사는 "2020년 7월부터 1년 8개월간 민수용 요금을 동결했고, 지난해
            하반기 이후 유가·가스 현물가격이 급등하면서 미수금이 급격히
            증가했다"며 "미수금 급증으로 가스공사 차입금이 확대되고, 사채 한도가
            연내에 소진될 전망"이라고 설명했다.
          </p>
          <p>
            공사는 경영 정상화를 위해 요금 인상 외에도 내년부터 2027년까지 약
            10조원 규모의 고강도 자구 노력을 펼칠 계획이다.
          </p>
          <p>
            산업부와 한전, 가스공사는 내년 요금 인상 방안에 대해 자체 시뮬레이션
            결과로, 부처 간 협의가 필요해 확정된 사안이 아니라는 입장이다. 이에
            따라 요금 인상 수준, 시기, 기간 등은 조정될 여지가 있다.
          </p>
  
          <br />
          <figure>
            <img src="src/assets/htmls/images/news/img2_3.jpg" />
            <figcaption>
              도시가스요금 인상 (PG)<br />
              [홍소영 제작] 일러스트
            </figcaption>
          </figure>
  
          <p class="name">
            redflag@yna.co.kr<br /><br />
            홍국기(redflag@yna.co.kr)<br />
            권희원(hee1@yna.co.kr)
          </p>
        </div>
      </div>
  
      <br /><br /><br /><br /><br />
    </body>
