      <body>
        <div id="wrapper">
          <h1>
            국내 중국인 투표권 박탈? 한동훈 “상호주의 없는 제도, 민의 왜곡 우려”
          </h1>
          <p class="data">입력 2022.12.01. 오후 6:44 수정 2022.12.01. 오후 9:09</p>
          <p class="name">김명진 기자</p>
    
          <div
            class="txt"
            style="overflow-x: hidden; height: 450px">
            <p class="boldTxt">
              법무부도 ‘한국 영주권자 참정권 제한 검토’ 국회 답변<br />
              韓 “현재는 자국 돌아가도 한국 투표권 유지하는 상황”
            </p>
    
            <p>
              한동훈 법무장관은 국내 영주권을 딴 외국인에게 참정권을 부여하는 현
              제도와 관련해 1일 “상호주의 원칙을 고려하지 않은 상태에서 투표권을
              부여하는 것은 민의를 왜곡할 수 있다는 상식적 우려가 있는 것으로
              안다”고 말했다. 최근 법무부는 ‘한국 영주권을 획득한 외국인의 참정권을
              제한하는 방안을 검토하고 있다’는 의견을 국회 의원실에 보낸 바 있다.
            </p>
            <br />
            <figure>
              <img src="src/assets/htmls/images/news/img3_1.jpg" />
              <figcaption>한동훈 법무장관. /뉴스1</figcaption>
            </figure>
    
            <p>
              한 장관은 이날 퇴근길에 관련 질문을 받고 “우리 국민은 영주권을 가져도
              해당국에서 투표권이 없는데 상대국 국민은 우리나라에서는 투표권을 갖는
              상황이 생길 수 있다”며 “상호주의 원칙은 이민정책을 펴나가는 데 있어서
              굉장히 중요한 원칙”이라며 이렇게 말했다.
            </p>
    
            <p>
              한 장관은 “지금 제도는 외국인이 영주권을 취득하면 아무런 조건 없이
              3년이 경과하면 지방선거 투표권을 부여하고 있다”고 했다.
            </p>
    
            <p>
              실제로 우리나라는 영주권 취득 3년이 지난 외국인에게 지방선거 투표권을
              부여하고 있다. 하지만 해외 거주 우리나라 국민은 대부분 해외에서
              선거권이 없다.
            </p>
    
            <p>
              중국과의 관계가 대표적이다. 우리나라는 3년 이상 국내 거주한 중국인에게
              지방선거 투표권을 주는 반면, 중국에 거주하는 한국인 영주권자는 현지
              투표권이 없다. 중앙선거관리위원회에 따르면 지난 지방선거에서 외국인
              유권자는 12만7623명었고, 대부분(9만9969명·국회예산정책처 3월 말
              추산)이 중국인이다. 이 때문에 지난 선거에서는 ‘중국인 표가 선거 결과를
              바꾼다’는 국민 불만이 온라인 커뮤니티 등을 통해 제기되기도 했다.
            </p>
    
            <p>
              한 장관은 “이 제도는 2005년 도입됐다. 당시 재일동포에 대한 일본의
              참정권 부여를 압박하기 위한 방편으로 우리가 선제적으로 이런 정책을
              펴자는 취지에서 나온 것”이라며. “지금 일본은 어차피 재일동포들에
              대해서 참정권 부여하고 있지도 않는다”고 했다. 영주권자에게 투표권을
              부여하고 있지 않은 미국, 프랑스, 일본, 캐나다 등의 외국 사례도
              설명했다.
            </p>
            <p>
              현행법상 한국 영주권자는 대선과 총선에선 투표권을 행사할 수 없지만
              지방선거에선 투표권을 행사할 수 있다. 영주권을 따고 3년이 지나면
              부여되고 있는데, 의무 거주 요건 등 별다른 제한은 없다. 한 장관은 “일단
              영주권을 따면 한국에서 생활하지 않고 자국으로 돌아가서 생활하더라도
              우리 지방선거에 투표권을 가지는 상황이 되는 것”이라고 했다.
            </p>
            <p>
              한 장관은 “이 같은 불합리를 해소하기 위해서 한국 영주권의 유지 요건에
              한국의 의무 거주 기간 요건을 도입하는 방안 등을 신중하게 검토하고
              있다”며 “이민·이주자들의 자발적이고 역동적인 기여를 국내 경제나 국가
              이익에 잘 활용하는 반면, 그로 인해 피해를 입거나 우려하는 부분들에
              대해 잘 지원하고 다독이는 정책을 잘 펴야 할 것”이라고 했다.
            </p>
    
            <p class="name">김명진 기자 cccv@chosun.com</p>
          </div>
        </div>
    
        <br /><br /><br /><br /><br />
      </body>
