      <body>
        <div id="wrapper">
          <h1>"애플페이 하는데 왜 우리가 20만원 써야하죠?" 사장님들 '한숨'</h1>
          <p class="data">입력 2022.12.01. 오전 6:11 수정 2022.12.01. 오전 6:12</p>
          <p class="name">김승한 기자</p>
    
          <div
            class="txt"
            style="overflow-x: hidden; height: 450px">
            <p class="boldTxt">
              [애플페이 오프라인 서비스 12월 말 예상<br />
              국내 가맹점 NFC 단말로 교체 해야할 수도<br />
              비용 15만~20만원 정도...영세 사업자 부담]
            </p>
            <br />
            <figure>
              <img src="src/assets/htmls/images/news/img5_1.jpg" />
              <figcaption>
                현대카드의 애플페이 11월 30일 출시 광고가 택시에서 목격됐다는 온라인
                커뮤니티 게시글<br />
                사진=온라인 커뮤니티
              </figcaption>
            </figure>
    
            <p>
              # 서울시 중구에서 17년째 삼겹살집을 운영하는 이모(56)씨. 최근
              애플페이가 도입된다는 소식에 결제 단말기를 바꿔야하나 고민하고 있다.
              현재 단말기는 애플페이 결제를 지원하지 않는 터라 교체 시 20만원의
              비용이 들어가서다. 이씨는 "교체비용이 부담스럽긴 한데 젊은 손님들이
              애플페이를 많이 쓸 것같아 시행되면 바꿔야할 것같다"고 말했다.
            </p>
    
            <p>
              업계에 따르면 현재 금융감독원은 현대카드가 애플페이 도입을 위해 신청한
              약관 심사를 진행 중이다. 금감원 관계자는 "현재 애플페이 약관을 열심히
              들여다보고 있지만 심사 완료 시기는 아직 확답해드리기 어렵다"고 말했다.
              통상 금감원의 금융 약관심사가 1~2개월의 물리적 시간이 소요된다는 점을
              고려하면 오프라인 정식 서비스는 이르면 12월 말로 업계는 예상한다.
            </p>
    
            <p>
              도입 시기만 확정되지 않았을 뿐 업계에선 애플페이 국내 서비스를
              기정사실화하고 있다. 이에 따라 일반 자영업자들 상대로 애플페이 지원
              단말기로 교체하라는 영업이 이뤄지고 있는 것으로 알려졌다. 서울
              종로구에서 디저트 가게를 운영하는 윤모(39)씨는 "단말기 업체가 최근
              방문해 애플페이 결제 단말기로 바꾸라는 제의를 했다"며 "자영업자 카페
              등에서도 이 같은 내용의 문구를 쉽게 찾아볼 수 있다"고 말했다.
            </p>
    
            <p>
              애플페이를 사용하려면 국내 신용카드 가맹점들이 결제 단말기를 바꿔야
              한다. 애플페이가 NFC(근거리무선통신) 결제 방식만 지원하기 때문이다.
              국내 신용카드 가맹점 290만개 중 NFC 기반 단말기를 보유한 곳은 약 10%에
              그친다. 국내 대부분 점포에서는 MST(마그네틱보안전송) 단말기를 사용하고
              있다. MST는 카드 마그네틱을 통해 결제 정보를 전송하는 방식인데,
              삼성페이는 NFC와 함께 MST도 지원해 단말기 교체가 불필요했다.
            </p>
    
            <br />
            <figure>
              <img src="src/assets/htmls/images/news/img5_2.jpg" />
              <figcaption>사진=온라인 자영업자 카페 캡처</figcaption>
            </figure>
    
            <p>
              NFC 지원 단말기 교체 비용은 통상 15만~20만원 정도다. 영세 사업자들은
              이 마저도 부담스럽다는 입장이다. 온라인 한 자업업자 카페에서 한 회원은
              "애플페이만을 위해 NFC 지원 단말기로 교체해야되는 건가요? 그 비용은
              누가 내나요"라고 우려했다.
            </p>
    
            <p>
              애플페이 국내 협력사인 현대카드가 단말기 교체 비용 일부를 지원해 줄
              수는 없을까. 여신전문금융업법 제19조6에 의하면
              "대형신용카드가맹점(연매출 3억원 초과) 및 그와 대통령령으로 정하는
              특수한 관계에 있는 자는 신용카드부가통신서비스 이용을 이유로
              부가통신업자에게 부당하게 보상금 등을 요구하거나 받아서는 아니된다"고
              명시하고 있다.
            </p>
            <p>
              달리 말하면, 연매출 3억원 미만 가맹점은 지원을 받을 수 있다는
              얘기이지만 현실성은 낮다는 게 업계의 시각이다. 금융권 한 관계자는
              "법적 문제를 떠나 단순 매출로 지원여부를 따지는 것은 형평성 문제가
              있는데다 애플 페이만을 위해 카드사가 그런 부담을 질 가능성이 낮다"고
              잘라말했다.
            </p>
    
            <p>
              한편 프렌차이즈 등 유통 업계에서는 애플페이를 염두에 둔 NFC 단말기
              교체 움직임이 곳곳에서 포착되고 있다. 이디야커피는 최근 매장
              점주들에게 NFC 기반의 결제장비 교체계획을 전달했다. 이디야 관계자는
              "이달부터 12월 말까지 POS 결제 단말기를 교체하고 내년 초 키오스크도
              교체할 예정"이라면서도 "애플페이와는 관계 없이 결제 다양화를 위한
              작업"이라고 설명했다. 롯데하이마트 일부 매장에서도 NFC 결제 단말기를
              교체한 것으로 알려졌다.
            </p>
    
            <p class="name">김승한 기자 (winone@mt.co.kr)</p>
          </div>
        </div>
    
        <br /><br /><br /><br /><br />
      </body>
